    <path d='M253 0V282' stroke='#C1BBEB' />
    <path d='M339 0V282' stroke='#C1BBEB' />
    <path d='M424 0V282' stroke='#C1BBEB' />
    <path d='M502 0V282' stroke='#C1BBEB' />
    <path d='M583 0V282' stroke='#C1BBEB' />
    <path d='M669 0V282' stroke='#C1BBEB' />
